import React, { useEffect, useRef, useState } from 'react'

const Map = props => {
  const [ map, setMap ] = useState({})
  const mapRef = useRef(null)

  const initMap = () => {
    const map = new google.maps.Map(mapRef.current, {
      center: {lat: -34.397, lng: 150.644},
      zoom: 8
    });

    setMap(map)
  }

  useEffect(() => {
    initMap()
  }, [])

  return (
    <div ref={mapRef}></div>
  )
}

export default Map
